import axios from "axios";

const ApiRequest = {
  Session: {
    Login: (params) => {
       async (dispatch) => {
        try {
          const loginResponse = await axios
            .post('https://dev.perseo.tv/ws/Login.php', {
              params: {
                user: '',
                pass: '',
                device: 'web'
              },
            })
            .then(res => {
              this.setState({
                movies: res.data.items,
                status: "success",
                loader: false
              });
              console.log(res);
              return res;
            });
        } catch (err) {

        }
      };
    }
  }
}

export default ApiRequest;
